    false,nt"url": null,nt"notes": "This annual narrative report for Chesapeake
    Marshlands National Wildlife Refuge Complex outlines Refuge accomplishments during
    the 2000 calendar year. The report begins with an introduction to the Refuge. Highlights
    and weather conditions are summarized for the year. Information about monitoring
    and studies- including surveys and censuses and studies and investigations- is provided
    next. Habitat restoration and management projects are also covered; activities include
    wetland restoration, upland restoration, water level management, moist soil management,
    mowing, farming, and prescribed burning. Fish and wildlife management are discussed
    next with emphasis on disease monitoring, nest structures, and animal control. Coordination
    activities, such as interagency coordination, are outlined. The resource protection
    section provides an update on law enforcement, wildfire preparedness, permits, contaminant
    investigation, and land acquisition support. Information about public education
    and recreation is given including visitor services and outreach. Finally, comprehensive
    management planning and general administration are discussed in the Refuge planning
    and administration section.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
